var test_CanvasManager, test_disp_img;

test_disp_img = function() {
  var browser_state, c, ci, i, j, m, np, tl, _ref, _ref2;
  c = new CanvasManager({
    el: document.body,
    allow_gl: true
  });
  c.items.push(new Background);
  m = new Mesh;
  c.items.push(m);
  np = 20;
  for (i = 0; 0 <= np ? i < np : i > np; 0 <= np ? i++ : i--) {
    for (j = 0; 0 <= np ? j < np : j > np; 0 <= np ? j++ : j--) {
      m.add_point([20 * i, 20 * j, 0.0]);
    }
  }
  tl = new Element_TriangleList;
  tl.indices.resize([3, 2 * (np - 1) * (np - 1)]);
  m.add_element(tl);
  ci = 0;
  for (i = 0, _ref = np - 1; 0 <= _ref ? i < _ref : i > _ref; 0 <= _ref ? i++ : i--) {
    for (j = 0, _ref2 = np - 1; 0 <= _ref2 ? j < _ref2 : j > _ref2; 0 <= _ref2 ? j++ : j--) {
      tl.indices.set_val([0, ci], (i + 0) * np + (j + 0));
      tl.indices.set_val([1, ci], (i + 1) * np + (j + 0));
      tl.indices.set_val([2, ci], (i + 0) * np + (j + 1));
      ci += 1;
      tl.indices.set_val([0, ci], (i + 1) * np + (j + 0));
      tl.indices.set_val([1, ci], (i + 1) * np + (j + 1));
      tl.indices.set_val([2, ci], (i + 0) * np + (j + 1));
      ci += 1;
    }
  }
  m.visualization.display_style.set("Wireframe");
  c.items.push(new Img('data:image/png;base64,'));
  c.fit();
  browser_state = new BrowserState;
  return browser_state.bind(function() {
    c.resize(browser_state.window_size[0], browser_state.window_size[1]);
    return c.draw();
  });
};

test_CanvasManager = function() {
  var bg, browser_state, c, c2, ci, d, e, fs, i, img, j, m, n, nn, np, op, s, tl, _ref, _ref2, _ref3;
  d = new_dom_element({
    parentNode: document.body,
    style: {
      position: "fixed",
      top: 0,
      left: 0,
      width: "70%",
      bottom: 0
    }
  });
  c = new CanvasManager({
    el: d,
    allow_gl: true
  });
  bg = new Background;
  c.items.push(bg);
  np = 20;
  m = new Mesh;
  s = np + 1;
  m.add_point([0, 0, 0]);
  m.add_point([s, 0, 0]);
  m.add_point([s, s, 0]);
  m.add_point([0, s, 0]);
  m.add_element(new Element_Line([0, 1]));
  m.add_element(new Element_Arc([1, 2, 3]));
  m.add_element(new Element_Line([3, 0]));
  op = m.nb_points();
  for (i = 0; 0 <= np ? i < np : i > np; 0 <= np ? i++ : i--) {
    for (j = 0; 0 <= np ? j < np : j > np; 0 <= np ? j++ : j--) {
      m.add_point([i, j, 0.3 * np * Math.sin(i / 3) * Math.sin(j / 3)]);
    }
  }
  tl = new Element_TriangleList;
  tl.indices.resize([3, 2 * (np - 1) * (np - 1)]);
  m.add_element(tl);
  ci = 0;
  for (i = 0, _ref = np - 1; 0 <= _ref ? i < _ref : i > _ref; 0 <= _ref ? i++ : i--) {
    for (j = 0, _ref2 = np - 1; 0 <= _ref2 ? j < _ref2 : j > _ref2; 0 <= _ref2 ? j++ : j--) {
      tl.indices.set_val([0, ci], op + (i + 0) * np + (j + 0));
      tl.indices.set_val([1, ci], op + (i + 1) * np + (j + 0));
      tl.indices.set_val([2, ci], op + (i + 0) * np + (j + 1));
      ci += 1;
      tl.indices.set_val([0, ci], op + (i + 1) * np + (j + 0));
      tl.indices.set_val([1, ci], op + (i + 1) * np + (j + 1));
      tl.indices.set_val([2, ci], op + (i + 0) * np + (j + 1));
      ci += 1;
    }
  }
  m.visualization.display_style.set("Surface with Edges");
  n = new NodalField(m);
  for (i = 0, _ref3 = m.nb_points(); 0 <= _ref3 ? i < _ref3 : i > _ref3; 0 <= _ref3 ? i++ : i--) {
    n._data.set_val(i, Math.sin(i));
  }
  nn = new NamedParametrizedDrawable("tst", n);
  fs = new FieldSet;
  fs.color_by.lst.push(nn);
  fs.warp_by.lst.push(new NamedParametrizedDrawable("dep", new VectorialField("dep", [nn, nn, nn])));
  c.items.push(fs);
  img = new Img('data:image/jpeg;base64,');
  c.items.push(new Axes);
  c.fit();
  d = new_dom_element({
    parentNode: document.body,
    style: {
      position: "fixed",
      top: 0,
      left: "70%",
      right: 0,
      bottom: 0
    }
  });
  c2 = new CanvasManager({
    el: d,
    allow_gl: true
  });
  c2.items.push(new Background);
  c2.items.push(new Axes);
  c2.items.push(img);
  c2.fit();
  e = new_model_editor({
    el: d,
    model: c.cam,
    label: "Cam data"
  });
  new_model_editor({
    el: d,
    model: bg,
    label: "Background data"
  });
  new_model_editor({
    el: d,
    model: fs,
    label: "field"
  });
  new_dom_element({
    parentNode: d,
    nodeName: "input",
    type: "button",
    value: "Delete selected points",
    onclick: function() {
      return m.delete_selected_point(c.cam_info);
    }
  });
  new_dom_element({
    parentNode: d,
    nodeName: "input",
    type: "button",
    value: "Round selected points",
    onclick: function() {
      return m.make_curve_line_from_selected(c.cam_info);
    }
  });
  browser_state = new BrowserState;
  return browser_state.bind(function() {
    c.resize(0.7 * browser_state.window_size[0], browser_state.window_size[1]);
    c.draw();
    c2.resize(0.3 * browser_state.window_size[0], c2.canvas.height);
    return c2.draw();
  });
};
